import React from 'react';

import './cart-item.style.css';

const CartItem = ({ item: {imageUrl, price, name, quantity} }) => (
    <div classNmae='cart-dropdown'>
        <img src={imageUrl} alt='item' />
        <div classNmae='dropdown-details'>
            <span classNmae='dropdown-name'>{name}</span>
            <span classNmae='dropdown-price'>{quantity} x {price}</span>
        </div>
    </div>
);

export default CartItem;
